import React, { useState, useEffect } from "react";
import Nav from "../components/Navbar";
import HelloFlashGrid from "../components/HelloFlashGrid";
import data from "../data";

function MyProjects() {

    return (
        <div>
            <h1>This is projects!!!!!!!</h1>
            <Nav />
            <p>
                {data.projectName}
            </p>
            <p>
                {data.description}
            </p>
            <p>
                {data.synopsis}
            </p>
            <p>
                {data.data}
            </p>
        </div>

    );
}


export default MyProjects;
